    <nav class="navbar navbar-expand-lg navbar-dark  bg-dark pe-1">
  <div class="container">
    <a class="navbar-brand">SEARCH_LESS</a>
      <form class="d-flex">
        <input class="form-control me-2" type="search_Less" placeholder="Search" aria-label="Search" id='input' />
        <button class="btn btn-outline-light" type="submit" onClick={search()}>Search</button>
      </form>
    </div>
</nav>
  )
}

export default Navbar
